  "rebaseWhen": "behind-base-branch"
}

{
  "extends": "tsconfig/base.json"
}

{
  "pipeline": {
    "build": {
      "dependsOn": ["^build"],
      "outputs": ["dist/**", ".next/**"]
    },
    "typecheck": {
      "outputs": []
    },
    "lint": {
      "outputs": []
    },
    "dev": {
      "cache": false
    },
    "coverage": {
      "dependsOn": ["rooks#build"],
      "cache": false,
      "outputs": ["src/coverage/**"]
    },
    "all-checks": {
      "dependsOn": ["coverage", "rooks#typecheck", "lint"],
      "cache": false,
      "outputs": []
    },
    "test": {
      "cache": false,
      "dependsOn": ["rooks#build"],
      "outputs": ["coverage/**", "dist/**", ".next/**"]
    },
    "start": {
      "cache": false,
      "dependsOn": ["build"],
      "outputs": ["dist/**", ".next/**"]
    }
  }
}
